Sprzedam Toyotę Yaris. Jestem pierwszym i jedynym właścicielem w kraju od 2017. Auto używane codziennie w mieście. Jak na razie bezawaryjne. 

Nowy akumulator (pisemna gwarancja ) - 01.2025

Duży serwis mechaniczny - sprzęgło, wszystkie przeguby, paski, płyny, elementy zawieszenia - 08.2024.

Auto stoi na oponach zimowych, dokładam komplet kół z oponami letnimi (można je samodzielnie przełożyć w 20 minut) - stan obu kompletów opon oceniam na bardzo dobry.

Auto wyposażone jak na ten model i rocznik bardzo bogato:

- automatyczna klimatyzacja - w pełni sprawna i wydajna;

- system bezkluczykowy - otwieranie, zamykanie na dotyk;

- uruchamianie - przycisk start/stop;

- elektryczne lusterka;

- elektryczne podnoszenie szyb z przodu;

- w zestawie dwa sterowniki(kluczyki);

- centralna blokada zamków;

Auto nosi widoczne ślady użytkowania. Nie ma oznak korozji. Do malowania jest tylny zderzak. Jest cały. Schodzi farba w wyniku jakiegoś błędu przy jego lakierowaniu we Włoszech (w Polsce nie było nic w aucie malowane). Do poprawki jest również lakier na dachu - schodzi bezbarwna warstwa. Nie robiłem z tym lakierem nic z uwagi na brak zagrożenia dla korozji i z racji potrzeby codziennego użytkowania. Sprzedaję, ponieważ zakupiłem nowsze auto. Cena zaniżona według rynku właśnie z uwagi na kwestie wyglądu lakieru. 

OC do 21 sierpnia 2025, przegląd do 23 stycznia 2026.

Data pierwszej rejestracji 19.12.2006.

Dla zainteresowanych mogę wysłać więcej zdjęć.

Dzień dobrym, mam do sprzedania samochód osobowy marki Suzuki Swift wyprodukowany w 2009 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1248 cm3, legitymujący się mocą 75 KM, który pokonał do tej pory 235000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Suzuki prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się bardzo dobrze, jest czyste, zadbane.



Swift jest wyposażenia w:

- Klimatyzację;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie;

- Elektryczne lusterka;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 25.08.2025 roku.

Przegląd techniczny 21.08.2025 roku.

